import "./App.css";
import { Routes, Route } from "react-router-dom";
import Homepage from "./Mycomponent/Pages/Homepage";
import HomeData from "./Mycomponent/Pages/HomeData";
import Login from "./Mycomponent/Authentication/Login";
import Adminpanal  from "./Mycomponent/Pages/Adminpanal"
import AppSidebar from "./Mycomponent/src/components/AppSidebar";
// import AppContent from "./Mycomponent/src/components/AppContent";
function App() { 
  return (
    <div className="App">
      <Routes>
        <Route exact path="/" element={<Homepage />} >
          <Route index element={<HomeData />} />
          <Route exact path="/login" element={<Login />} />
        </Route>
        <Route exact path="/adminpanal" element={< AppSidebar/> } />

      </Routes>
    </div>
  );
}

export default App;
